                            ContentAr = "• المعرفة التامة بإجراءات الإيقاف وتبليغ السلطات المختصة عند الضرورة والتحفظ على المشتبه فيهم داخل حدود الموقع.\n• تنظيم حركة دخول وخروج رواد الموقع وضبط ورقابة المداخل والمخارج.\n• المعرفة التامة بكيفية التعامل مع المعدات الأمنية المتاحة وأمثل الطرق لاستخدامها.\n• استيعاب تعليمات الأمن الدائمة والالتزام بتنفيذها.\n• إجادة أسلوب التعامل مع الآخرين في إطار العلاقات العامة والاستقبال.\n• المحافظة على مواعيد العمل حضوراً وانصرافاً مع ضرورة التواجد على رأس العمل أثناء ساعات الدوام الرسمية.\n• الالتزام بارتداء الزي الرسمي الخاص برجال الأمن وعليه شعار الطرف الأول في جميع أوقات العمل والمحافظة على نظافة وحسن المظهر العام.\n• حمل المعدات الشخصية والضرورية التي تطلبها ضرورة العمل.\n\n• القيام بواجبات الحراسة الأمنية الراجلة والراكبة وكافة ما يتطلب عمل الحارس الأمني من واجب المراقبة والمتابعة والانتباه للمواقع التي يحددها الطرف الثاني على مدار عمله.\n• تقديم المساعدة والإسعافات الأولية والإرشادات لرواد الموقع وتوجيههم في حالة طلبهم ذلك وتنظيم عملية الدخول والخروج في الأماكن الغير مسموح بدخولها وإغلاق الأبواب ومنع الدخول عند انتهاء المواعيد المحددة من قبل الطرف الثاني وتشغيل وإطفاء الإنارة وقت الحاجة.\n• تولي المسئولية لدى حدوث أي مشاجرات أو مشاكل داخل الموقع والعمل على منع تطورها أو حلها أو رفعها لممثل الطرف الثاني.\n• اتخاذ كافة الاحتياطات وإجراءات السلامة اللازمة والتوجه بها للطرف الثاني لدرء الأخطار المحدقة مثل (إبعاد أي مواد أو أجهزة مشتبه فيها أو قد ينشأ من وجودها خطر حريق أو انفجار).\n• تدقيق وفحص التصاريح والوثائق والمستندات الخاصة بالتحكم في دخول المبنى ومراقبة سلامته وإنارته مثل (شاشات المراقبة – أجهزة الإنذار – الأبواب – أجهزة الاتصال – الإضاءة).\n• اتخاذ ما يلزم عند حدوث أي تحرك أو نشاط مشبوه أو أية مشاكل أو أحداث غير طبيعية داخل أو حول المواقع من قبل أي شخص أو مجموعات والإبلاغ الفوري عنها.\n• يلتزم الطرف الأول بالتأكد من قيام حراس الأمن التابعين له بمهام الحراسة المطلوبة منهم على مدار الساعة.\n• يلتزم حراس الأمن بعدم الإفشاء عن أي معلومات أو وقائع تصل إليهم أثناء تواجدهم في الموقع لأي جهة أخرى.\n• يلتزم الطرف الأول بتحمل كافة الالتزامات التي تنشأ عند تشغيله لحراس الأمن ويلتزم بدفع رواتبهم في مواعيدها حيث لن يقبل الطرف الثاني أية مطالبة مباشرة منهم ويتحمل الطرف الأول كافة الالتزامات المالية المتعلقة بهم ويستوفي كافة الإجراءات اللازمة لتشغيلهم.\n• لا يحق للطرف الثاني إعطاء موظفي الطرف الأول رواتبهم أو سلفه مالية وإذا قام بذلك لا يحق له خصمها من مستحقات الطرف الأول .\n• يقوم الطرف الأول بتغطية المواقع في حالة العطلات والأعياد والجمع والإجازات.",
                            ContentEn = "• Full knowledge of stop procedures and reporting to the relevant authorities when necessary, and detaining suspects within the site boundaries.\n• Organizing the movement of site visitors and controlling the entrances and exits.\n• Full knowledge of how to handle available security equipment and the best methods for its use.\n• Understanding and adhering to ongoing security instructions.\n• Proficiency in dealing with others in public relations and reception.\n• Maintaining work schedules, both in attendance and departure, with a requirement to be on duty during official working hours.\n• Complying with wearing the official uniform with the first party's logo at all times during work hours and maintaining cleanliness and a neat appearance.\n• Carrying personal and essential equipment required by the nature of the job.\n\n• Performing the duties of foot and mounted security guards, including surveillance, monitoring, and paying attention to the locations specified by the second party during their shift.\n• Providing assistance, first aid, guidance to site visitors, and directing them when requested. Regulating entry and exit to restricted areas, locking doors, and preventing access after the designated times by the second party, including turning lights on or off when necessary.\n• Taking responsibility in the event of any disputes or issues within the site, working to prevent escalation, resolve the issue, or report it to the second party’s representative.\n• Taking all necessary safety precautions and reporting to the second party to mitigate potential hazards, such as moving any suspicious materials or equipment that could pose a fire or explosion risk.\n• Inspecting and verifying permits, documents, and records related to building access control, safety, and lighting, such as surveillance monitors, alarms, doors, communication devices, and lighting.\n• Taking action in the event of any suspicious movement or activity or any unusual incidents or events within or around the site, reported immediately.\n• The first party must ensure that their security guards are fulfilling their required duties around the clock.\n• Security guards must not disclose any information or incidents they become aware of during their presence on the site to any other party.\n• The first party is responsible for all obligations related to employing security guards, including paying their salaries on time. The second party will not accept any direct claims from the guards and the first party assumes all financial obligations regarding them and completes all necessary employment procedures.\n• The second party does not have the right to pay the first party’s employees their salaries or offer them financial advances. If done, it cannot be deducted from the first party's dues.\n• The first party is responsible for covering the sites during holidays, public holidays, and vacation periods.",
                            IsDeleted = false,
                            TitleAr = "الواجبات والخدمات",
                            TitleEn = "Duties & Services"
                        });
                });

